import React from "react";
import 'https://ticketscandy.com/js/tc_widgets.js';

function AdmissionTickets() {
  return (
    <div>
      <div id="tc-container-iframe"></div>
      <script>
        document.addEventListener('DOMContentLoaded', function(event){" "}
        {TCWidget.init(
          "tc-container-iframe",
          "https://ticketscandy.com/event/adventureroominstamuseum/tickets/"
        )}
        );
      </script>
    </div>
  );
}

export default AdmissionTickets;
